/* Procedure structure for procedure `spGetstudentinformation` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetstudentinformation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetstudentinformation`(_card_id VARCHAR(500))
BEGIN
		SELECT `studinfo`.`studinfo_id` `ID`,
			CONCAT(`studinfo`.`studinfo_lastname` , ', ' , 
			 `studinfo`.`studinfo_firstname` , ' ' , 
			 `studinfo`.`studinfo_middlename` , ' ' , 
			 `studinfo`.`studinfo_suffixname`) `NAME`,
			 `studinfo`.`studinfo_piclocation` `PICTURE`,
			 `lvl`.`acadlvl_name` `LVL_NAME`,
			 `yr`.`acadyr_name` `YR_NAME`,
			 `prd`.`acadprd_name` `PRD_NAME`,
			 `yrlvl`.`acadyrlvl_name` `YRLVL_NAME`,		 
			 `crse`.`acadcrse_name` `CRSE_NAME`,
			 `sec`.`acadsec_name` `SEC_NAME`,
			 `studrfidinfo`.`studrfidcardinfo_id` `STUDRFIDCARDINFO_ID`,
			 0 `DEVINFO_ID`,
			 `lvl`.`acadlvl_id` `LVL_ID`,
			 `yr`.`acadyr_id` `YR_ID`,
			 `prd`.`acadprd_id` `PRD_ID`,
			 `yrlvl`.`acadyrlvl_id` `YRLVL_ID`,
			 `crse`.`acadcrse_id` `CRSE_ID`,
			 `sec`.`acadsec_id` `SEC_ID`
			   FROM `studentinformation` `studinfo`
				LEFT JOIN `studentrfidcardinformation` `studrfidinfo`
					ON `studinfo`.`studinfo_id` = `studrfidinfo`.`studinfo_id`
				LEFT JOIN `academiclevel` `lvl`
					ON `studinfo`.`acadlvl_id` = `lvl`.`acadlvl_id`
				LEFT JOIN `academicyear` `yr`
					ON `studinfo`.`acadyr_id` = `yr`.`acadyr_id`
				LEFT JOIN `academicperiod` `prd`
					ON `studinfo`.`acadprd_id` = `prd`.`acadprd_id`
				LEFT JOIN `academicyearlevel` `yrlvl`
					ON `studinfo`.`acadyrlvl_id` = `yrlvl`.`acadyrlvl_id`
				LEFT JOIN `academiccourse` `crse`
					ON `studinfo`.`acadcrse_id` = `crse`.`acadcrse_id`
				LEFT JOIN `academicsection` `sec`
					ON `studinfo`.`acadsec_id` = `sec`.`acadsec_id`
			WHERE `studrfidinfo`.`studrfidcardinfo_cardid` = _card_id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spINSERTattendancelogs` */

/*!50003 DROP PROCEDURE IF EXISTS  `spINSERTattendancelogs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spINSERTattendancelogs`(_attendlog_datetime VARCHAR(50),
					_studrfidcardinfo_cardid VARCHAR(500),
					_studrfidcardinfo_id BIGINT, 
					_studinfo_id BIGINT, 
					_devinfo_id BIGINT, 
					_acadlvl_id BIGINT,
					_acadyr_id BIGINT,
					_acadprd_id BIGINT,
					_acadyrlvl_id BIGINT,
					_acadcrse_id BIGINT,
					_acadsec_id BIGINT,
					OUT _attendlog_id BIGINT)
BEGIN
	  INSERT INTO `attendancelogs`(
			`attendlog_datetime`,
			`studrfidcardinfo_cardid`,
			`studrfidcardinfo_id`,
			`studinfo_id`,
			`devinfo_id`,
			`acadlvl_id`,
			`acadyr_id`,
			`acadprd_id`,
			`acadyrlvl_id`,
			`acadcrse_id`,
			`acadsec_id`)
		VALUES(_attendlog_datetime,
			_studrfidcardinfo_cardid,
			_studrfidcardinfo_id,
			_studinfo_id,
			_devinfo_id,
			_acadlvl_id,
			_acadyr_id,
			_acadprd_id,
			_acadyrlvl_id,
			_acadcrse_id,
			_acadsec_id);
	 SET _attendlog_id = LAST_INSERT_ID();
END */$$
DELIMITER ;

/* Procedure structure for procedure `spLOGINsystemuser` */

/*!50003 DROP PROCEDURE IF EXISTS  `spLOGINsystemuser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spLOGINsystemuser`(_sysuser_name VARCHAR(100),_sysuser_password VARCHAR(4000))
BEGIN
DECLARE _sysuserid BIGINT(20);
	SET _sysuserid = (SELECT CASE ISNULL(`sysuser_id`)
				   WHEN 1 THEN 
					0 
				   ELSE
					`sysuser_id`
				 END 
			  FROM `systemuser` 
				WHERE `sysuser_status` = 1 AND
				      `sysuser_isactive` = 1 AND 
				      `sysuser_name` = _sysuser_name AND 
				      `sysuser_password` = MD5(_sysuser_password) LIMIT 0,1);
	IF (_sysuserid > 0) THEN
		SELECT `user`.`sysuser_name` `NAME`,
		       `user`.`sysuser_privilege` `PRIV`,
		       `mod`.`sysmod_code` `MOD_CODE`,
		       `mod`.`sysmod_name` `MOD_NAME`,
		       `mod`.`sysmod_desc` `MOD_DESC`,
		       `user`.`sysmod_id` `MOD_ID`,
		       `user`.`user_id` `USER_ID`,
		       `user`.`sysuser_id` `ID`
			FROM `systemuser` `user`
                    LEFT JOIN `systemmodule` `mod`
			ON `user`.`sysmod_id` = `mod`.`sysmod_id`
		    WHERE `user`.`sysuser_id` = _sysuserid;
	ELSE
		SELECT '' `NAME`,
		       '' `PRIV`,
		       '' `MOD_CODE`,
		       '' `MOD_NAME`,
		       '' `MOD_DESC`,
		       0 `MOD_ID`,
		       0 `USER_ID`,
		       0 `ID`;
	END IF;
    END */$$
DELIMITER ;

